import React from "react";
import { GoogleMap, LoadScript, Marker } from "@react-google-maps/api";

const miniMapContainer = {
  width: "100%",
  height: "300px",
};

const center = {
  lat: 14.1467,
  lng: 121.4708,
};

const popularSpots = [
  { name: "Taytay Falls", visitors: "Very High" },
  { name: "Dalitiwan Resort", visitors: "High" },
  { name: "Nuestra Señora de la Porteria Church", visitors: "Moderate" },
];

function Home() {
  return (
    <div className="p-6 grid grid-cols-1 md:grid-cols-2 gap-6">
      {/* Mini Map */}
      <div className="shadow-lg rounded-lg overflow-hidden">
        <LoadScript googleMapsApiKey="AIzaSyA6D72kCqt2yln8Yhfg0Y0iE25F0ndZtO4">
          <GoogleMap mapContainerStyle={miniMapContainer} center={center} zoom={13}>
            <Marker position={center} />
          </GoogleMap>
        </LoadScript>
      </div>

      {/* Most Visited Places */}
      <div className="bg-white shadow-lg rounded-lg p-4">
        <h2 className="text-xl font-bold mb-4">Most Visited Places</h2>
        <ul className="space-y-2">
          {popularSpots.map((spot, index) => (
            <li key={index} className="p-2 border rounded">
              <span className="font-semibold">{spot.name}</span> – {spot.visitors} visitors
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default Home;
